	Definir vector Como Entero;
	Definir i, j, k, n, aux Como Entero;
	Definir ordenado Como Logico;
	Escribir "Introduzca la longiud del vector: ";
	Leer n;
	Dimension vector[n];
	
	Para i<-0 Hasta n-1 Con Paso 1
		vector[i]<- Aleatorio(1,99);
	FinPara	
	
	ordenado <- Falso;
	j<-0;
	Mientras (j < n-1) & (ordenado = Falso) Hacer
		Si (vector[j] > vector[j+1]) Entonces
			aux <- vector[j+1];
			vector[j+1] <- vector[j];
			vector[j] <- aux;
			j <- j+1;
		SiNo
			
		FinSi
	FinMientras
	
	
	
	Para i<-0 Hasta n-1 Con Paso 1
		Escribir Sin Saltar " ", vector[i], ",";
	FinPara
	
	
